  // Filtrar os CPFs que tm mais de uma unidade
  const cpfsDuplicados = [...cpfContagem.entries()].filter(([cpf, count]) => count > 1).map(([cpf]) => cpf);
  
  // Exibir as unidades pertencentes aos CPFs encontrados
  const unidadesDuplicadas = unidades.filter(({ cpf_proprietario }) => cpfsDuplicados.includes(cpf_proprietario));
  
  console.log("Unidades pertencentes a CPFs com mais de uma unidade:", unidadesDuplicadas);
  